literals:
display: flex;
  align-items: center;
  justify-content: space-between;

  cursor: pointer;

  padding: 5px 3px;
  border-radius: 5px;

  background-color: transparent;
  transition: background-color 0.2s;

  > div {
    display: flex;
    align-items: center;
  }

  > div span {
    font-size: 15px;
    margin-left: 5px;
    color: var(--senary);
  }

  > div:nth-child(2) {
    display: none;
  }

  &:hover,
  &:active {
    background-color: var(--quinary);
    > div:last-child {
      display: block;
    }

    > div {
      span {
        color: var(--white);
      }
    }
  }

